import './App.css';
import bg from './img/main-bg.jpg';
import {Navigation, NavDropDown, Nav, Container, Navbar} from 'react-bootstrap';
import { useEffect } from 'react';
import './../node_modules/bootstrap/dist/css/bootstrap.min.css';

function App() {
  useEffect(()=>{
    document.getElementById('bg').style.backgroundImage = `url('${bg}')`;
  });
  return (
    <div id='bg' style={{height: '400px', backgroundSize: 'cover'}}>
      <header className="custom d-flex justify-content-around">
        <Navbar expand="xxl">
          <Navbar.Brand href='#'>Cozy House</Navbar.Brand>
          <Navbar.Toggle  aria-controls="basic-navbar-nav"/>
          <Navbar.Collapse id='basic-navbar-nav'>
            <Nav.Link href='#'>About the shelter</Nav.Link>
            <Nav.Link href='#'>Our pets</Nav.Link>
            <Nav.Link href='#'>Help the shelter</Nav.Link>
            <Nav.Link href='#'>Contacts</Nav.Link>
          </Navbar.Collapse>
        </Navbar>
      </header>
    </div>
  );
}

export default App;
